import React, { useEffect } from 'react';
import {
    Nav, Navbar, Container
  } from 'react-bootstrap';

function Mapa() {

  useEffect(() => {
    let email = "mcovarrubias@uc.cl";
    let password = "18640729";
    const payload = {
        "type": "JOIN",
        "payload": {
            "authorization": `Basic ${btoa(`${email}:${password}`)}`
        }
    }
    const socket = new WebSocket("wss://tarea2-2023-1-dev-z2fqxmm2ja-uc.a.run.app/connect"); // replace with your server's URL
    socket.onopen = () => {
      console.log('WebSocket connection established.');
      socket.send(JSON.stringify(payload));

    };



  }, []); // empty dependency array ensures this effect only runs once

  return (
    <Navbar style={{backgroundColor: "#ffb6c1"}}>
      <Container>
        <Navbar.Brand href="#home">CotelinApp</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav"  />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/">Menu</Nav.Link>
            <Nav.Link href="/courses">Platos</Nav.Link>
            <Nav.Link href="/ingredients">Ingredientes</Nav.Link>

          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Mapa;
